-- Table structure for table `car`
--

DROP TABLE IF EXISTS `car`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `car` (
  `id` varchar(128) COLLATE utf8_bin NOT NULL COMMENT '主键',
  `license` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '车牌号',
  `password` varchar(45) COLLATE utf8_bin DEFAULT NULL COMMENT '司机登陆密码',
  `carheight` double DEFAULT NULL COMMENT '车高',
  `carlength` double DEFAULT NULL COMMENT '车长',
  `carno` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '车编号',
  `carstatus` int(11) DEFAULT '0' COMMENT '车状态',
  `cartype` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '车型',
  `volume` double DEFAULT NULL COMMENT '容积',
  `carwidth` double DEFAULT NULL COMMENT '车宽',
  `company` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '所属公司',
  `currentlocation` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '当前坐标',
  `engineno` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '发动机号',
  `frameno` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '车架',
  `insuranceno` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '保险号',
  `leftload` double DEFAULT NULL COMMENT '剩余载重',
  `memo` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '说明/描述',
  `operationno` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '运营证书号',
  `targetcity` varchar(255) COLLATE utf8_bin DEFAULT '全国' COMMENT '行车路线',
  `totalload` double DEFAULT NULL COMMENT '载重',
  `updatetime` datetime DEFAULT NULL COMMENT '发布运力时间',
  `verified` char(1) COLLATE utf8_bin DEFAULT '0' COMMENT '是否验证发布运力(0发布，1未发布)',
  `carcity` varchar(45) COLLATE utf8_bin DEFAULT NULL COMMENT '当前城市',
  `generatetime` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `localcity` varchar(45) COLLATE utf8_bin DEFAULT NULL COMMENT '车归属地',
  `carcredit` double DEFAULT '0' COMMENT '积分/星级',
  `creditcount` int(11) DEFAULT '0' COMMENT '成交次数',
  `status` char(1) COLLATE utf8_bin DEFAULT '0' COMMENT '用户状态 默认值0,0：正常， 1禁止',
  `iscar` char(1) COLLATE utf8_bin DEFAULT '0' COMMENT '是否是系统车辆,默认是系统车辆',
  `photo` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '车辆照片',
  `agentid` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '货代公司的id',
  `maxload` double DEFAULT NULL COMMENT '车最大承载量',
  `padimei` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT 'PAD IMEI码',
  `certificateno` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '行车证号码',
  `backload` double DEFAULT NULL COMMENT '返程剩余吨位',
  `leftvolume` double DEFAULT NULL COMMENT '剩余容积',
  `backvolume` double DEFAULT NULL COMMENT '返程容积',
  `authentication` char(1) COLLATE utf8_bin DEFAULT '0' COMMENT '车辆认证0认证，1未认证',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;
/*!40101 SET character_set_client = @saved_cs_client */;

