  `authorid` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '投诉人id',
  `authorrole` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '投诉人角色 0货代，1司机，2物流企业',
  `complaintid` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '被投诉人id',
  `complaintrole` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '被投诉人角色 0货代，1司机，2物流企业',
  `goodsid` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '货源ID',
  `complainttype` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '投诉原因',
  `status_` char(1) COLLATE utf8_bin DEFAULT '0' COMMENT '处理状态:  1处理中，2投诉成功，3投诉驳回,4撤消',
