  `orderid` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '订单编号',
  `operator` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '处理人id',
  `result` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '处理结果',
  `handingdate` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '处理完成时间',
  `complaintno` char(125) COLLATE utf8_bin DEFAULT NULL COMMENT '投诉编号',
  `isread` char(1) COLLATE utf8_bin DEFAULT '1' COMMENT '是否已读：0否，1是',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;
