  `carid` varchar(128) COLLATE utf8_bin NOT NULL COMMENT '抢单司机对应的车辆ID',
  `generatetime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '推送抢单消息给司机的时间',
  `completetime` datetime DEFAULT NULL COMMENT '司机抢单的时间',
  `grabflag` char(1) COLLATE utf8_bin DEFAULT '0' COMMENT '司机是否已抢单，默认0是未抢单，1是已抢单，2是已失效',
  `grabresult` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '抢单结果，0未抢到 1审批中 2抢单成功 3抢单失败',
  `orderid` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '抢单成功后对应的订单ID',
  `failurereason` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '抢单失败原因，备用字段',
  `goodstime` datetime DEFAULT NULL COMMENT '货源创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;
/*!40101 SET character_set_client = @saved_cs_client */;

