DROP TABLE IF EXISTS `noticeinfo`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `noticeinfo` (
  `id` varchar(125) COLLATE utf8_bin DEFAULT NULL,
  `content` varchar(1024) COLLATE utf8_bin DEFAULT NULL COMMENT '内容',
  `generatetime` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `url` varchar(1024) COLLATE utf8_bin DEFAULT NULL COMMENT '链接地址',
  `validity` decimal(10,1) DEFAULT NULL COMMENT '有效天数',
  `senderId` varchar(125) COLLATE utf8_bin DEFAULT NULL COMMENT '发送人id',
  `status` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '状态',
  `expirationDate` datetime DEFAULT NULL COMMENT '失效日期',
  `receiverId` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '接收人id',
  `receiverType` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '0-全部,1-司机,2-货代,3-指定接收人'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='公告通知';
