DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `nextvalue`(p_id_name VARCHAR(20)) RETURNS int(11)
    DETERMINISTIC
    SQL SECURITY INVOKER
BEGIN
  DECLARE return_value  INT DEFAULT NULL;
  DECLARE increment_val INT DEFAULT NULL;
  DECLARE EXIT HANDLER FOR SQLEXCEPTION
  BEGIN
    return -1;
  END;
  SELECT t.curvaule
       , t.increment
  INTO
    return_value, increment_val
  FROM
    sequence t
  WHERE
    t.id_name = p_id_name
    AND t.valid_date = curdate();
  IF isnull(return_value) THEN
    UPDATE sequence
    SET
      curvaule = 0, valid_date = curdate()
    WHERE
      id_name = p_id_name;
     
    RETURN 0;
  ELSE
    UPDATE sequence
    SET
      curvaule = curvaule + increment
    WHERE
      id_name = p_id_name;
      
    RETURN return_value + increment_val;
  END IF;
END ;;
DELIMITER ;
