  IF i_carcitysql IS NOT NULL THEN
    IF i_targetcitysql IS NOT NULL THEN
      SELECT group_concat(concat(a.id) SEPARATOR ',')
      INTO
        v_recommendId
      FROM
        (
        SELECT g.id
        FROM
          goods g
        WHERE
          (i_carcitysql)
