         , c.volume
         , c.fare
         , c.memo
         , c.fetchdate
         , c.agentid
         , c.goodsno
         , c.goodsname
         , c.goodstype
         , c.count
         , c.declaredvalue
         , c.agentno
         , c.photo
         , c.company
         , c.address
         , c.name
         , c.tel
         , c.agentcredit
         , c.astatus
         , c.creditcount
         , c.agentid
         , c.num
    FROM
      (
      (SELECT g.id
            , g.receiptprovince
            , g.receiptcity
            , g.receiptregion
            , g.originalprovince
            , g.originalcity
            , g.originalregion
            , g.weight
            , g.carlength
            , g.volume
            , g.fare
            , g.memo
            , g.fetchdate
            , g.agentid
            , g.goodsno
            , g.goodsname
            , g.goodstype
            , g.count
            , g.declaredvalue
            , a.agentno
            , a.photo
            , a.company
            , a.address
            , a.name
            , a.tel
            , a.agentcredit
            , a.status AS astatus
            , a.creditcount
            , a.id AS agentid
            , 1 AS num
       FROM
         goods g, agent a
       WHERE
         -- 此处可以优化成这样
         g.id IN (v_recommendId)
       --            g.originalregion = i_originalregion
       --            AND g.receiptregion LIKE concat('%', i_receiptregion, '%')
       --            AND g.weight <= i_weight
       --            AND g.fetchdate >= now()
       --            AND a.id = g.agentid
       --           AND g.completedate IS NULL
       ORDER BY
         fare DESC
       LIMIT
         5)
      UNION ALL
      (SELECT g.id
            , g.receiptprovince
            , g.receiptcity
            , g.receiptregion
            , g.originalprovince
            , g.originalcity
            , g.originalregion
            , g.weight
            , g.carlength
            , g.volume
            , g.fare
            , g.memo
            , g.fetchdate
            , g.agentid
            , g.goodsno
            , g.goodsname
            , g.goodstype
            , g.count
            , g.declaredvalue
            , a.agentno
            , a.photo
            , a.company
            , a.address
            , a.name
            , a.tel
            , a.agentcredit
            , a.status AS astatus
            , a.creditcount
            , a.id AS agentid
            , 2 AS num
       FROM
         goods g, agent a
       WHERE
         g.fetchdate >= now()
         AND g.assigncarno = i_carid
         AND a.id = g.agentid
         AND g.id NOT IN (v_recommendId)
         AND g.completedate IS NULL
       ORDER BY
         g.generatetime
         DESC
      )
      )
      c
    )
    UNION ALL
    (
    SELECT g.id
         , g.receiptprovince
         , g.receiptcity
         , g.receiptregion
         , g.originalprovince
         , g.originalcity
         , g.originalregion
         , g.weight
         , g.carlength
         , g.volume
         , g.fare
         , g.memo
         , g.fetchdate
         , g.agentid
         , g.goodsno
         , g.goodsname
         , g.goodstype
         , g.count
         , g.declaredvalue
         , a.agentno
         , a.photo
         , a.company
         , a.address
         , a.name
         , a.tel
         , a.agentcredit
         , a.status AS astatus
         , a.creditcount
         , a.id AS agentid
         , 0 AS num
    FROM
      goods g, agent a
    WHERE
      g.fetchdate >= now()
      AND g.assigncarno IS NULL
      AND a.id = g.agentid
      AND g.id NOT IN (v_recommendId)
      AND g.completedate IS NULL
    ORDER BY
      g.generatetime
      DESC))
    ) t
  ;
END IF;
