CREATE DEFINER=`root`@`%` PROCEDURE `CountOrderByCar`(IN pi_carid VARCHAR(128))
    DETERMINISTIC
    SQL SECURITY INVOKER
    COMMENT '个人中心各状态订单数量统计'
BEGIN
  DECLARE v_payorder     INT;
  DECLARE v_pickingorder INT;
  DECLARE v_signorder    INT;
  DECLARE v_evelorder    INT;
  DECLARE v_refundorder  INT;
  -- 待付款订单
  SELECT count(1)
  INTO
    v_payorder
  FROM
    orders
  WHERE
    carid = pi_carid
    AND status = '0';
  -- 待配货订单
  SELECT count(1)
  INTO
    v_pickingorder
  FROM
    orders
  WHERE
    carid = pi_carid
    AND (STATUS = '3'
        OR STATUS = '1');
  -- 待签收订单
  SELECT count(1)
  INTO
    v_signorder
  FROM
    orders
  WHERE
    carid = pi_carid
    AND status = '6';
  -- 待评价订单
  SELECT count(1)
  INTO
    v_evelorder
  FROM
    orders
  WHERE
    carid = pi_carid
    AND (status = '7'
    OR status = '8'
    OR status = '10');
  -- 退款订单
  SELECT count(1)
  INTO
    v_refundorder
  FROM
    orders
  WHERE
    carid = pi_carid
    AND status = '12';
  SELECT ifnull(v_payorder, 0) AS payorder
       , ifnull(v_pickingorder, 0) AS pickingorder
       , ifnull(v_signorder, 0) AS signorder
       , ifnull(v_evelorder, 0) AS evelorder
       , ifnull(v_refundorder, 0) AS cancelorder;
END ;;
DELIMITER ;
