CREATE DEFINER=`root`@`%` PROCEDURE `GetMyCarsCount`(IN pi_agentid VARCHAR(128))
    DETERMINISTIC
    SQL SECURITY INVOKER
    COMMENT '我的车队数量'
BEGIN
  DECLARE v_allmycars     INT;
  DECLARE v_collectmycars INT;
  DECLARE v_othercars     INT;
  DECLARE v_dealmycars    INT;
  DECLARE EXIT HANDLER FOR SQLEXCEPTION
  BEGIN
    SELECT 0 AS allmycars
         , 0 AS collectmycars
         , 0 AS dealmycars
         , 0 AS othercars;
  --     SET PO_returnVal = 2;
  --     SET PO_errorMsg = '数据库异常，请稍后重试';
  END;
  -- 全部车辆
  SELECT count(1)
  INTO
    v_allmycars
  FROM
    mycars my,car c
  WHERE
    my.carid = c.id AND c.agentid IS NULL
    AND my.agentid = pi_agentid;
  -- 收藏车辆
  SELECT count(1)
  INTO
    v_collectmycars
  FROM
    mycars my,car c
  WHERE
    my.carid = c.id AND c.agentid IS NULL
    AND my.agentid = pi_agentid
    AND type = 0;
  -- 交易车辆
  SELECT count(1)
  INTO
    v_dealmycars
  FROM
    mycars my,car c
  WHERE
    my.carid = c.id AND c.agentid IS NULL
    AND my.agentid = pi_agentid
    AND type = 1;
  -- 其他车辆
  SELECT count(1)
  INTO
    v_othercars
  FROM
    mycars my,car c
  WHERE
    my.carid = c.id AND c.agentid IS NULL
    AND my.agentid = pi_agentid
    AND type = 2;
  SELECT ifnull(v_allmycars, 0) AS allmycars
       , ifnull(v_collectmycars, 0) AS collectmycars
       , ifnull(v_dealmycars, 0) AS dealmycars
       , ifnull(v_othercars, 0) AS othercars;
END ;;
DELIMITER ;
