CREATE DEFINER=`root`@`%` PROCEDURE `GetMyGoodsMonth`(IN pi_datestatus INTEGER,
                                 IN pi_agentId    VARCHAR(128)
                                 )
    DETERMINISTIC
    SQL SECURITY INVOKER
    COMMENT '我的货源查询货源数量'
BEGIN

  DECLARE v_allGoods        INT;
  DECLARE v_myGoods         INT;
  DECLARE v_noresponseGoods INT;
  DECLARE v_favoritedGoods  INT;
  DECLARE c_CurrentDate     DATE DEFAULT date_add(now(), INTERVAL -3 MONTH);
  DECLARE EXIT HANDLER FOR SQLEXCEPTION
  BEGIN
    SELECT 0 AS allcount
         , 0 AS newcount
         , 0 AS nocount
         , 0 AS mycount;
  --     SET PO_returnVal = 2;
  --     SET PO_errorMsg = '数据库异常，请稍后重试';
  END;

  IF pi_datestatus = 0 THEN
    -- 全部
    SELECT count(1)
    INTO
      v_allGoods
    FROM
      goods
    WHERE
      (agentid = pi_agentId
      AND status = '0')

      AND
      generatetime >= c_CurrentDate;
    -- 新货源
    SELECT count(1)
    INTO
      v_myGoods
    FROM
      goods
    WHERE
      agentid = pi_agentId
      AND
      fetchdate >= now()
      AND generatetime >= c_CurrentDate
      AND completedate IS NULL
      AND status = '0';

    -- 无响应
    SELECT count(1)
    INTO
      v_noresponseGoods
    FROM
      goods
    WHERE
      agentid = pi_agentId
      AND fetchdate < now()
      AND completedate IS NULL
      AND generatetime >= c_CurrentDate
      AND status = '0';
    -- 交易的货源
    SELECT count(1)
    INTO
      v_favoritedGoods
    FROM
      goods
    WHERE
      agentid = pi_agentId
      AND generatetime >= c_CurrentDate
      AND goods.completedate IS NOT NULL
      AND status = '0';

  ELSEIF pi_datestatus = 1 THEN -- --------------------------------三个月前
    -- 全部
    SELECT count(1)
    INTO
      v_allGoods
    FROM
      goods
    WHERE
      agentid = pi_agentId
      AND status = '0'
      AND
      generatetime < c_CurrentDate;
    -- new
    SELECT count(1)
    INTO
      v_myGoods
    FROM
      goods
    WHERE
      agentid = pi_agentId
      AND fetchdate >= now()
      AND completedate IS NULL
      AND generatetime < c_CurrentDate
      AND status = '0';
    -- 无效
    SELECT count(1)
    INTO
      v_noresponseGoods
    FROM
      goods
    WHERE
      agentid = pi_agentId
      AND fetchdate < now()
      AND completedate IS NULL
      AND generatetime < c_CurrentDate
      AND status = '0';
    -- deal 
    SELECT count(1)
    INTO
      v_favoritedGoods
    FROM
      goods
    WHERE
      agentid = pi_agentId
      AND generatetime < c_CurrentDate
      AND completedate IS NOT NULL
      AND status = '0';

  END IF;
  SELECT ifnull(v_allGoods, 0) AS allcount
       , ifnull(v_myGoods, 0) AS newcount
       , ifnull(v_noresponseGoods, 0) AS nocount
       , ifnull(v_favoritedGoods, 0) AS mycount; -- deal
END ;;
DELIMITER ;
