CREATE DEFINER=`root`@`%` PROCEDURE `GetMyOrdersMonth`(IN pi_datestatus INTEGER,
                                  IN pi_type       INTEGER,
                                  IN pi_id         VARCHAR(128)
                                  )
    DETERMINISTIC
    SQL SECURITY INVOKER
    COMMENT '我的订单查询货源数量'
BEGIN
  -- 功能维度：
  -- 1 本月成交量最多的5个货代及具体的成交量
  -- 2 本月货源发布量
  -- 3 本月货源成交量
  -- 4 本月货车新增量


  -- 全部
  DECLARE v_allorder       INT;
  -- 已预订/待付款
  DECLARE v_payorder       INT;
  -- 待收款(货代)
  DECLARE v_collectorder   INT;
  -- 配货中/待配货
  DECLARE v_pickingorder   INT;
  -- 到达收货地/待签收
  DECLARE v_signorder      INT;
  -- 待评价
  DECLARE v_evelorder      INT;
  -- 已取消
  DECLARE v_cancelorder    INT;
  DECLARE v_appointorder   INT;
  -- 运输中
  DECLARE v_transportorder INT;
  -- 已成交
  DECLARE v_dealorder      INT;
  DECLARE c_CurrentDate    DATE DEFAULT date_add(now(), INTERVAL -3 MONTH);
  DECLARE EXIT HANDLER FOR SQLEXCEPTION
  BEGIN
    SELECT 0 AS allorder
         , 0 AS payorder
         , 0 AS pickingorder
         , 0 AS signorder
         , 0 AS evelorder
         , 0 AS cancelorder
         , 0 AS appointorder
         , 0 AS transportorder
         , 0 AS collectorder
         , 0 AS dealorder;
  --     SET PO_returnVal = 2;
  --     SET PO_errorMsg = '数据库异常，请稍后重试';
  END;

  IF pi_datestatus = 0 THEN
    -- 司机
    IF pi_type = 0 THEN
      -- 全部订单
      SELECT count(1)
      INTO
        v_allorder
      FROM
        orders
      WHERE
        carid = pi_id
        AND TYPE <> '2'
        AND STATUS <> '13'
        AND generatetime >= date_add(now(), INTERVAL -3 MONTH);
      -- 付款订单
      SELECT count(1)
      INTO
        v_payorder
      FROM
        orders
      WHERE
        carid = pi_id
        AND STATUS = '0'
        AND
        generatetime >= date_add(now(), INTERVAL -3 MONTH);
      -- 配货订单
      SELECT count(1)
      INTO
        v_pickingorder
      FROM
        orders
      WHERE
        carid = pi_id
        AND (STATUS = '3'
        OR STATUS = '1')
        AND
        generatetime >= date_add(now(), INTERVAL -3 MONTH);      
      -- 运输中 (揽货和执行中)
      SELECT count(1)
      INTO
        v_transportorder
      FROM
        orders
      WHERE
        carid = pi_id
        AND (STATUS = '4'
        OR STATUS = '5')
        AND
        generatetime >= date_add(now(), INTERVAL -3 MONTH);
      -- 签收订单
      SELECT count(1)
      INTO
        v_signorder
      FROM
        orders
      WHERE
        carid = pi_id
        AND STATUS = '6'
        AND
        generatetime >= date_add(now(), INTERVAL -3 MONTH);
      -- 评价订单
      SELECT count(1)
      INTO
        v_evelorder
      FROM
        orders
      WHERE
        carid = pi_id
        AND (STATUS = '7'
        OR STATUS = '8'
        OR STATUS = '10')
        AND
        generatetime >= date_add(now(), INTERVAL -3 MONTH);
      -- 已取消
      SELECT count(1)
      INTO
        v_cancelorder
      FROM
        orders
      WHERE
        carid = pi_id
        AND STATUS = '2'
        AND TYPE <> '2'
        AND
        generatetime >= date_add(now(), INTERVAL -3 MONTH);
      -- 已指派订单(待接单)
      SELECT count(1)
      INTO
        v_appointorder
      FROM
        orders
      WHERE
        carid = pi_id
        AND STATUS = '-1'
        AND
        generatetime >= date_add(now(), INTERVAL -3 MONTH);
      -- 交易成功
      SELECT count(1)
      INTO
        v_dealorder
      FROM
        orders
      WHERE
        carid = pi_id
        AND STATUS = '11'
        AND TYPE <> '2'
        AND
        generatetime >= date_add(now(), INTERVAL -3 MONTH);

    ELSEIF pi_type = 1 THEN
      -- 全部订单
      SELECT count(1)
      INTO
        v_allorder
      FROM
        orders
      WHERE
        agentid = pi_id
        AND TYPE <> '1'
        AND STATUS <> '13'
        AND generatetime >= date_add(now(), INTERVAL -3 MONTH);
      -- 已预订
      SELECT count(1)
      INTO
        v_payorder
      FROM
        orders
      WHERE
        agentid = pi_id
        AND STATUS = '0'
        AND
        generatetime >= date_add(now(), INTERVAL -3 MONTH);
      -- 待收款
      SELECT count(1)
      INTO
        v_collectorder
      FROM
        orders
      WHERE
        agentid = pi_id
        AND STATUS = '1'
        AND
        generatetime >= date_add(now(), INTERVAL -3 MONTH);
      -- 配货中
      SELECT count(1)
      INTO
        v_pickingorder
      FROM
        orders
      WHERE
        agentid = pi_id
        AND (STATUS = '3'
        OR STATUS = '4')
        AND
        generatetime >= date_add(now(), INTERVAL -3 MONTH);
       -- 运输中
      SELECT count(1)
      INTO
        v_transportorder
      FROM
        orders
      WHERE
        agentid = pi_id
        AND STATUS = '5'
        AND
        generatetime >= date_add(now(), INTERVAL -3 MONTH);
      -- 到达收货地
      SELECT count(1)
      INTO
        v_signorder
      FROM
        orders
      WHERE
        agentid = pi_id
        AND STATUS = '6'
        AND
        generatetime >= date_add(now(), INTERVAL -3 MONTH);
      -- 评价订单
      SELECT count(1)
      INTO
        v_evelorder
      FROM
        orders
      WHERE
        agentid = pi_id
        AND (STATUS = '7'
        OR STATUS = '8'
        OR STATUS = '9')
        AND
        generatetime >= date_add(now(), INTERVAL -3 MONTH);
      -- 已取消
      SELECT count(1)
      INTO
        v_cancelorder
      FROM
        orders
      WHERE
        agentid = pi_id
        AND STATUS = '2'
        AND TYPE <> '1'
        AND
        generatetime >= date_add(now(), INTERVAL -3 MONTH);
      -- 交易成功
      SELECT count(1)
      INTO
        v_dealorder
      FROM
        orders
      WHERE
        agentid = pi_id
        AND STATUS = '11'
        AND TYPE <> '1'
        AND
        generatetime >= date_add(now(), INTERVAL -3 MONTH);
    END IF;
  ELSEIF pi_datestatus = 1 THEN
    -- 司机
    IF pi_type = 0 THEN
      -- 全部订单
      SELECT count(1)
      INTO
        v_allorder
      FROM
        orders
      WHERE
        carid = pi_id
        AND TYPE <> '2'
        AND STATUS <> '13'
        AND generatetime < date_add(now(), INTERVAL -3 MONTH);
      -- 付款订单
      SELECT count(1)
      INTO
        v_payorder
      FROM
        orders
      WHERE
        carid = pi_id
        AND STATUS = '0'
        AND
        generatetime < date_add(now(), INTERVAL -3 MONTH);
      -- 配货订单
      SELECT count(1)
      INTO
        v_pickingorder
      FROM
        orders
      WHERE
        carid = pi_id
        AND (STATUS = '3'
        OR STATUS = '1')
        AND
        generatetime < date_add(now(), INTERVAL -3 MONTH);      
      -- 运输中 (揽货和执行中)
      SELECT count(1)
      INTO
        v_transportorder
      FROM
        orders
      WHERE
        carid = pi_id
        AND (STATUS = '4'
        OR STATUS = '5')
        AND
        generatetime < date_add(now(), INTERVAL -3 MONTH);
      -- 签收订单
      SELECT count(1)
      INTO
        v_signorder
      FROM
        orders
      WHERE
        carid = pi_id
        AND STATUS = '6'
        AND
        generatetime < date_add(now(), INTERVAL -3 MONTH);
      -- 评价订单
      SELECT count(1)
      INTO
        v_evelorder
      FROM
        orders
      WHERE
        carid = pi_id
        AND (STATUS = '7'
        OR STATUS = '8'
        OR STATUS = '10')
        AND
        generatetime < date_add(now(), INTERVAL -3 MONTH);
      -- 已取消
      SELECT count(1)
      INTO
        v_cancelorder
      FROM
        orders
      WHERE
        carid = pi_id
        AND STATUS = '2'
        AND TYPE <> '2'
        AND
        generatetime < date_add(now(), INTERVAL -3 MONTH);
      -- 已指派订单(待接单)
      SELECT count(1)
      INTO
        v_appointorder
      FROM
        orders
      WHERE
        carid = pi_id
        AND STATUS = '-1'
        AND
        generatetime < date_add(now(), INTERVAL -3 MONTH);
      -- 交易成功
      SELECT count(1)
      INTO
        v_dealorder
      FROM
        orders
      WHERE
        carid = pi_id
        AND STATUS = '11'
         AND TYPE <> '2'
        AND
        generatetime < date_add(now(), INTERVAL -3 MONTH);

    ELSEIF pi_type = 1 THEN
      -- 全部订单
      SELECT count(1)
      INTO
        v_allorder
      FROM
        orders
      WHERE
        agentid = pi_id
        AND TYPE <> '1'
        AND STATUS <> '13'
        AND generatetime < date_add(now(), INTERVAL -3 MONTH);
      -- 已预订
      SELECT count(1)
      INTO
        v_payorder
      FROM
        orders
      WHERE
        agentid = pi_id
        AND STATUS = '0'
        AND
        generatetime < date_add(now(), INTERVAL -3 MONTH);
      -- 待收款
      SELECT count(1)
      INTO
        v_collectorder
      FROM
        orders
      WHERE
        agentid = pi_id
        AND STATUS = '1'
        AND
        generatetime < date_add(now(), INTERVAL -3 MONTH);
      -- 配货中
      SELECT count(1)
      INTO
        v_pickingorder
      FROM
        orders
      WHERE
        agentid = pi_id
        AND (STATUS = '3'
        OR STATUS = '4')
        AND
        generatetime < date_add(now(), INTERVAL -3 MONTH);
       -- 运输中
      SELECT count(1)
      INTO
        v_transportorder
      FROM
        orders
      WHERE
        agentid = pi_id
        AND STATUS = '5'
        AND
        generatetime < date_add(now(), INTERVAL -3 MONTH);
      -- 到达收货地
      SELECT count(1)
      INTO
        v_signorder
      FROM
        orders
      WHERE
        agentid = pi_id
        AND STATUS = '6'
        AND
        generatetime < date_add(now(), INTERVAL -3 MONTH);
      -- 评价订单
      SELECT count(1)
      INTO
        v_evelorder
      FROM
        orders
      WHERE
        agentid = pi_id
        AND (STATUS = '7'
        OR STATUS = '8'
        OR STATUS = '9')
        AND
        generatetime < date_add(now(), INTERVAL -3 MONTH);
      -- 已取消
      SELECT count(1)
      INTO
        v_cancelorder
      FROM
        orders
      WHERE
        agentid = pi_id
        AND STATUS = '2'
        AND TYPE <> '1'
        AND
        generatetime < date_add(now(), INTERVAL -3 MONTH);
      -- 交易成功
      SELECT count(1)
      INTO
        v_dealorder
      FROM
        orders
      WHERE
        agentid = pi_id
        AND STATUS = '11'
        AND TYPE <> '1'
        AND
        generatetime < date_add(now(), INTERVAL -3 MONTH);
    END IF;
  END IF;
  SELECT ifnull(v_allorder, 0) AS allorder
     , ifnull(v_payorder, 0) AS payorder
     , ifnull(v_pickingorder, 0) AS pickingorder
     , ifnull(v_signorder, 0) AS signorder
     , ifnull(v_evelorder, 0) AS evelorder
     , ifnull(v_cancelorder, 0) AS cancelorder
     , ifnull(v_appointorder, 0) AS appointorder
     , ifnull(v_transportorder, 0) AS transportorder
     , ifnull(v_collectorder, 0) AS collectorder
     , ifnull(v_dealorder, 0) AS dealorder;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
/*!50003 DROP PROCEDURE IF EXISTS `GetStatistics` */;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
/*!50003 SET character_set_client  = utf8 */ ;
/*!50003 SET character_set_results = utf8 */ ;
/*!50003 SET collation_connection  = utf8_general_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = 'STRICT_TRANS_TABLES,NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `GetStatistics`(IN PI_interval INTEGER-- , -- 0:一周，1：一年
)
    DETERMINISTIC
    SQL SECURITY INVOKER
    COMMENT '获取展厅需要的统计信息'
BEGIN
  -- 功能维度：
  -- 1 货车数量：****辆
  --   运输公司****家
  --   当前位于襄阳的货车数量共：****辆
  -- 
  -- 2 货物交易量达****吨
  --    由襄阳发往最远的城市：
  --    和襄阳业务往来最多的城市：
  -- 时间维度：最近一周,最近一年
  -- 
  -- 3 货源信息发布量*****条
  --    货源信息成交量****条
  --    成交量最多的信息部:****
  --    交易量最多的司机：****
  -- 时间维度：最近一周，最近一年
  DECLARE c_CurrentTime     DATETIME DEFAULT sysdate();
  DECLARE v_CarCount        INTEGER; -- 货车数量
  DECLARE v_CarInXYCount    INTEGER; -- 当前位于襄阳的货车数量
  DECLARE v_AgentCount      INT; -- 运输公司
  DECLARE v_GoodsWeiht_Y    DOUBLE; -- 货物交易量(吨)(最近一年)
  DECLARE v_GoodsWeiht_W    DOUBLE; -- 货物交易量(吨)(最近一周)
  DECLARE v_CityBest_Y      VARCHAR(100); -- 和襄阳业务往来最多的城市(最近一年)
  DECLARE v_CityBest_W      VARCHAR(100); -- 和襄阳业务往来最多的城市(最近一周)
  -- DECLARE v_CityFarthest_Y  VARCHAR(100); -- 由襄阳发往最远的城市(最近一年)
  -- DECLARE v_CityFarthest_W  VARCHAR(100); -- 由襄阳发往最远的城市(最近一周)
  DECLARE v_GoodsCount_Y    INTEGER; -- 货源信息发布量(最近一年)
  DECLARE v_GoodsCount_W    INTEGER; -- 货源信息发布量(最近一周)
  DECLARE v_GoodsHot_Y      VARCHAR(100); -- 热门货物(最近一年)
  DECLARE v_GoodsHot_W      VARCHAR(100); -- 热门货物(最近一周)
  DECLARE v_GoodsComplete_Y INTEGER; -- 货源信息成交量(最近一年)
  DECLARE v_GoodsComplete_W INTEGER; -- 货源信息成交量(最近一周)
  DECLARE v_AgentBestID     VARCHAR(100);
  DECLARE v_CarBestId       VARCHAR(100);
  DECLARE v_AgentBest_Y     VARCHAR(100); -- 成交量最多的信息部(最近一年)
  DECLARE v_AgentBest_W     VARCHAR(100); -- 成交量最多的信息部(最近一周)
  DECLARE v_DriverBest_Y    VARCHAR(500); -- 成交量最多的司机  (最近一年)
  DECLARE v_DriverBest_W    VARCHAR(500); -- 成交量最多的司机  (最近一周)
  DECLARE EXIT HANDLER FOR SQLEXCEPTION
  BEGIN
    SELECT 0
         , 0
         , 0
         , 0
         , ''
         , 0
         , 0
         , ''
         , ''
         , '';
  --     SET PO_returnVal = 2;
  --     SET PO_errorMsg = '数据库异常，请稍后重试';
  END;
  -- 统计货车数量
  SELECT count(1)
  INTO
    v_CarCount
  FROM
    car;
  -- 统计货代数量
  SELECT count(1)
  INTO
    v_AgentCount
  FROM
    agent t;
  -- 当前位于襄阳的货车数量
  SELECT count(1)
  INTO
    v_CarInXYCount
  FROM
    car t
  WHERE
    instr(t.localcity, '襄阳') > 0;
  -- 根据输入的时间间隔返回不同时期的数据
  IF PI_interval = 0 THEN
    -- 货物交易量(吨)及成交量(笔)(最近一周)
    SELECT sum(b.weight)
         , count(1)
    INTO
      v_GoodsWeiht_W, v_GoodsComplete_W
    FROM
      goods b
    WHERE
      b.goodsstatus = 2
      AND timestampdiff(WEEK, b.publishtime, c_CurrentTime) = 0;
    -- 由襄阳发往最远的城市：(最近一周)
    --     SELECT temp.receiptcity
    --     INTO
    --       v_CityFarthest_W
    --     FROM
    --       citydistance a, (SELECT receiptprovince
    --                             , receiptcity
    --                             , count(1) cnt
    --                        FROM
    --                          goods
    --                        WHERE
    --                          originalcity = '襄阳'
    --                          AND timestampdiff(WEEK, publishtime, c_CurrentTime) = 0
    --                        GROUP BY
    --                          receiptprovince
    --                        , receiptcity) temp
    --     WHERE
    --       a.originProvince = '湖北'
    --       AND a.originCity = '襄阳'
    --       AND a.destinationProvince = temp.receiptprovince
    --       AND a.destinationCity = temp.receiptcity
    --     ORDER BY
    --       a.distanceValue DESC
    --     , temp.cnt DESC
    --     LIMIT
    --       1;
    -- 和襄阳业务往来最多的5个城市：(最近一周)
    SELECT group_concat(concat(temp.cityBest, ',', temp.weightSum, ',', temp.weightSucSum) SEPARATOR '|')
    INTO
      v_CityBest_W
    FROM
      (SELECT
         CASE
         WHEN t.originalcity = '襄阳' THEN
           t.receiptcity
         ELSE
           t.originalcity
         END cityBest
       , sum(t.weight) weightSum
       , sum(
         CASE
         WHEN t.goodsstatus = 2 THEN
           t.weight
         ELSE
           0
         END) weightSucSum
       FROM
         goods t
       WHERE
         timestampdiff(WEEK, publishtime, c_CurrentTime) = 0
         AND ((t.originalcity = '襄阳'
         AND t.receiptcity != '襄阳')
         OR (t.receiptcity = '襄阳'
         AND t.originalcity != '襄阳'))
       GROUP BY
         cityBest
       ORDER BY
         weightSum DESC
       LIMIT
         5) temp;
    -- 货源信息发布量(最近一周)
    SELECT count(1)
    INTO
      v_GoodsCount_W
    FROM
      goods
    WHERE
      timestampdiff(WEEK, publishtime, c_CurrentTime) = 0;
    -- 热门货物（最近一周）
    SELECT group_concat(temp.goodsname SEPARATOR ',')
    INTO
      v_GoodsHot_W
    FROM
      (
      SELECT goodsname
      FROM
        goods
      WHERE
        timestampdiff(WEEK, publishtime, c_CurrentTime) = 0
        AND goodsname IS NOT NULL
      GROUP BY
        goodsname
      ORDER BY
        count(1) DESC
      LIMIT
        3) temp;
    -- 成交量最多的信息部:(最近一周)
    SELECT t.id
         , concat(t.company, ',', count(1)) cnt
    INTO
      v_AgentBestID, v_AgentBest_W
    FROM
      goods a, agent t
    WHERE
      a.agentid = t.id
      AND a.goodsstatus = 2
      AND timestampdiff(WEEK, a.completetime, c_CurrentTime) = 0
    GROUP BY
      t.id
    , t.company
    ORDER BY
      cnt DESC
    , sum(a.fare) DESC
    LIMIT
      1;
    -- 与此信息部交易中最多的5位
    SELECT
      CASE
      WHEN char_length(group_concat(concat(temp.drivername, ',', temp.cnt) SEPARATOR '|')) > 0 THEN
        concat(v_AgentBest_W, '|', group_concat(concat(temp.drivername, ',', temp.cnt) SEPARATOR '|'))
      ELSE
        v_AgentBest_W
      END
    INTO
      v_AgentBest_W
    FROM
      (
      SELECT c.drivername
           , count(1) cnt
      FROM
        orders t, car c
      WHERE
        t.agentid = v_AgentBestID
        AND t.carid = c.id
        AND timestampdiff(WEEK, t.completetime, c_CurrentTime) = 0
      GROUP BY
        c.drivername
      ORDER BY
        cnt DESC
      LIMIT
        5) temp;
    -- 交易量最多的司机：(最近一周)
    SELECT temp.carid
         , concat(c.drivername, ',', temp.cnt)
    INTO
      v_CarBestId, v_DriverBest_W
    FROM
      car c, (
      SELECT b.carid
           , count(1) cnt
      FROM
        orders b, goods a
      WHERE
        b.goodsid = a.id
        AND a.goodsstatus = 2
        AND timestampdiff(WEEK, a.completetime, c_CurrentTime) = 0
      GROUP BY
        b.carid
      ORDER BY
        cnt DESC
      , sum(a.fare) DESC
      LIMIT
        1) temp
    WHERE
      c.id = temp.carid
    LIMIT
      1;
    -- 该司机交易最多的5个货代：(最近一周)
    SELECT
      CASE
      WHEN char_length(group_concat(concat(temp.company, ',', temp.cnt) SEPARATOR '|')) > 0 THEN
        concat(v_DriverBest_W, '|', group_concat(concat(temp.company, ',', temp.cnt) SEPARATOR '|'))
      ELSE
        v_DriverBest_W
      END
    INTO
      v_DriverBest_W
    FROM
      (
      SELECT a.company
           , count(1) cnt
      FROM
        agent a, orders o
      WHERE
        a.id = o.agentid
        AND o.carid = v_CarBestId
        AND timestampdiff(WEEK, o.completetime, c_CurrentTime) = 0
      GROUP BY
        a.company
      ORDER BY
        cnt
      LIMIT
        5) temp;
    --     SET PO_returnVal = 0;
    --     SET PO_errorMsg = 'Success!';
    -- 返回结果集
    SELECT ifnull(v_CarCount, 0)
         , ifnull(v_CarInXYCount, 0)
         , ifnull(v_AgentCount, 0)
         , ifnull(v_GoodsWeiht_W, 0)
         , ifnull(v_CityBest_W, '')
         -- , ifnull(v_CityFarthest_W, '')
           , ifnull(v_GoodsCount_W, 0)
         , ifnull(v_GoodsComplete_W, 0)
         , ifnull(v_GoodsHot_w, '')
         , ifnull(v_AgentBest_W, '')
         , ifnull(v_DriverBest_W, '');
  ELSEIF PI_interval = 1 THEN
    -- 货物交易量(吨)及成交量(笔)(最近一年)
    SELECT sum(b.weight)
         , count(1)
    INTO
      v_GoodsWeiht_Y, v_GoodsComplete_Y
    FROM
      goods b
    WHERE
      b.goodsstatus = 2
      AND timestampdiff(YEAR, b.publishtime, c_CurrentTime) = 0;
    -- 由襄阳发往最远的城市：(最近一周)
    --     SELECT temp.receiptcity
    --     INTO
    --       v_CityFarthest_Y
    --     FROM
    --       citydistance a, (SELECT receiptprovince
    --                             , receiptcity
    --                             , count(1) cnt
    --                        FROM
    --                          goods
    --                        WHERE
    --                          originalcity = '襄阳'
    --                          AND timestampdiff(YEAR, publishtime, c_CurrentTime) = 0
    --                        GROUP BY
    --                          receiptprovince
    --                        , receiptcity) temp
    --     WHERE
    --       a.originProvince = '湖北'
    --       AND a.originCity = '襄阳'
    --       AND a.destinationProvince = temp.receiptprovince
    --       AND a.destinationCity = temp.receiptcity
    --     ORDER BY
    --       a.distanceValue DESC
    --     , temp.cnt DESC
    --     LIMIT
    --       1;
    -- 和襄阳业务往来最多的5个城市：(最近一年)
    SELECT group_concat(concat(temp.cityBest, ',', temp.weightSum, ',', temp.weightSucSum) SEPARATOR '|')
    INTO
      v_CityBest_Y
    FROM
      (SELECT
         CASE
         WHEN t.originalcity = '襄阳' THEN
           t.receiptcity
         ELSE
           t.originalcity
         END cityBest
       , sum(t.weight) weightSum
       , sum(
         CASE
         WHEN t.goodsstatus = 2 THEN
           t.weight
         ELSE
           0
         END) weightSucSum
       FROM
         goods t
       WHERE
         timestampdiff(YEAR, publishtime, c_CurrentTime) = 0
         AND ((t.originalcity = '襄阳'
         AND t.receiptcity != '襄阳')
         OR (t.receiptcity = '襄阳'
         AND t.originalcity != '襄阳'))
       GROUP BY
         cityBest
       ORDER BY
         weightSum DESC
       LIMIT
         5) temp;
    -- 货源信息发布量(最近一周)
    SELECT count(1)
    INTO
      v_GoodsCount_Y
    FROM
      goods
    WHERE
      timestampdiff(YEAR, publishtime, c_CurrentTime) = 0;
    -- 热门货物（最近一周）
    SELECT group_concat(temp.goodsname SEPARATOR ',')
    INTO
      v_GoodsHot_Y
    FROM
      (
      SELECT goodsname
      FROM
        goods
      WHERE
        timestampdiff(YEAR, publishtime, c_CurrentTime) = 0
        AND goodsname IS NOT NULL
      GROUP BY
        goodsname
      ORDER BY
        count(1) DESC
      LIMIT
        3) temp;
    -- 成交量最多的信息部:(最近一周)
    SELECT t.id
         , concat(t.company, ',', count(1)) cnt
    INTO
      v_AgentBestID, v_AgentBest_Y
    FROM
      goods a, agent t
    WHERE
      a.agentid = t.id
      AND a.goodsstatus = 2
      AND timestampdiff(WEEK, a.completetime, c_CurrentTime) = 0
    GROUP BY
      t.id
    , t.company
    ORDER BY
      cnt DESC
    , sum(a.fare) DESC
    LIMIT
      1;
    -- 与此信息部交易中最多的5位
    SELECT
      CASE
      WHEN char_length(group_concat(concat(temp.drivername, ',', temp.cnt) SEPARATOR '|')) > 0 THEN
        concat(v_AgentBest_Y, '|', group_concat(concat(temp.drivername, ',', temp.cnt) SEPARATOR '|'))
      ELSE
        v_AgentBest_Y
      END
    INTO
      v_AgentBest_Y
    FROM
      (
      SELECT c.drivername
           , count(1) cnt
      FROM
        orders t, car c
      WHERE
        t.agentid = v_AgentBestID
        AND t.carid = c.id
        AND timestampdiff(YEAR, t.completetime, c_CurrentTime) = 0
      GROUP BY
        c.drivername
      ORDER BY
        cnt DESC
      LIMIT
        5) temp;
    -- 交易量最多的司机：(最近一周)
    SELECT temp.carid
         , concat(c.drivername, ',', temp.cnt)
    INTO
      v_CarBestId, v_DriverBest_Y
    FROM
      car c, (
      SELECT b.carid
           , count(1) cnt
      FROM
        orders b, goods a
      WHERE
        b.goodsid = a.id
        AND a.goodsstatus = 2
        AND timestampdiff(YEAR, a.completetime, c_CurrentTime) = 0
      GROUP BY
        b.carid
      ORDER BY
        cnt DESC
      , sum(a.fare) DESC
      LIMIT
        1) temp
    WHERE
      c.id = temp.carid
    LIMIT
      1;
    -- 该司机交易最多的5个货代：(最近一周)
    SELECT
      CASE
      WHEN char_length(group_concat(concat(temp.company, ',', temp.cnt) SEPARATOR '|')) > 0 THEN
        concat(v_DriverBest_Y, '|', group_concat(concat(temp.company, ',', temp.cnt) SEPARATOR '|'))
      ELSE
        v_DriverBest_Y
      END
    INTO
      v_DriverBest_Y
    FROM
      (
      SELECT a.company
           , count(1) cnt
      FROM
        agent a, orders o
      WHERE
        a.id = o.agentid
        AND o.carid = v_CarBestId
        AND timestampdiff(YEAR, o.completetime, c_CurrentTime) = 0
      GROUP BY
        a.company
      ORDER BY
        cnt
      LIMIT
        5) temp;
    --     SET PO_returnVal = 0;
    --     SET PO_errorMsg = 'Success!';
    -- 返回结果集
    SELECT ifnull(v_CarCount, 0)
         , ifnull(v_CarInXYCount, 0)
         , ifnull(v_AgentCount, 0)
         , ifnull(v_GoodsWeiht_Y, 0)
         , ifnull(v_CityBest_Y, '')
         -- , ifnull(v_CityFarthest_Y, '')
           , ifnull(v_GoodsCount_Y, 0)
         , ifnull(v_GoodsComplete_Y, 0)
         , ifnull(v_GoodsHot_Y, '')
         , ifnull(v_AgentBest_Y, '')
         , ifnull(v_DriverBest_Y, '');
  ELSE
    SELECT ifnull(v_CarCount, 0)
         , ifnull(v_CarInXYCount, 0)
         , ifnull(v_AgentCount, 0)
         , ifnull(v_GoodsWeiht_Y, 0)
         , ifnull(v_CityBest_Y, '')
         -- , ifnull(v_CityFarthest_Y, '')
           , ifnull(v_GoodsCount_Y, 0)
         , ifnull(v_GoodsComplete_Y, 0)
         , ifnull(v_GoodsHot_Y, '')
         , ifnull(v_AgentBest_Y, '')
         , ifnull(v_DriverBest_Y, '');
