/*!50003 DROP PROCEDURE IF EXISTS `GetStatisticsCurMonth` */;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
/*!50003 SET character_set_client  = utf8 */ ;
/*!50003 SET character_set_results = utf8 */ ;
/*!50003 SET collation_connection  = utf8_general_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = 'STRICT_TRANS_TABLES,NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `GetStatisticsCurMonth`(IN pi_AgnetId VARCHAR(100))
    DETERMINISTIC
    SQL SECURITY INVOKER
    COMMENT '统计当月货源运行情况'
BEGIN
  -- 功能维度：
  -- 1 本月成交量最多的5个货代及具体的成交量
  -- 2 本月货源发布量
  -- 3 本月货源成交量
  -- 4 本月货车新增量
  -- 5 新订单
  -- 6 待付款
  -- 7 待评价
  -- 8 货源描述
  -- 9 服务质量
  DECLARE v_AgentBest        VARCHAR(100);
  DECLARE v_GoodsPublishCnt  INT;
  DECLARE v_GoodsCompleteCnt INT;
  DECLARE v_CarNew           INT;
  DECLARE v_NEWOrderCnt           INT;
  DECLARE v_MONOrderCnt           INT;
  DECLARE v_COMOrderCnt           INT;
  DECLARE c_CurrentDate      DATE DEFAULT curdate();
  DECLARE EXIT HANDLER FOR SQLEXCEPTION
  BEGIN
    SELECT ''
         , 0
         , 0
         , 0
         , 0
         , 0
         , 0;
  --     SET PO_returnVal = 2;
  --     SET PO_errorMsg = '数据库异常，请稍后重试';
  END;
  SELECT group_concat(concat(temp.company, ',', temp.cnt) SEPARATOR '|')
  INTO
    v_AgentBest
  FROM
    (SELECT t.company
          , count(1) cnt
     FROM
       goods a, agent t
     WHERE
       t.id = a.agentid
       AND a.goodsstatus = 2
       AND a.completetime >= date_sub(c_CurrentDate, INTERVAL day(c_CurrentDate) - 1 DAY)
     GROUP BY
       t.id
     ORDER BY
       cnt DESC
     , sum(a.fare) DESC
     , sum(a.weight) DESC
     LIMIT
       5) temp;
  -- 2 本月货源发布量
  SELECT count(1)
  INTO
    v_GoodsPublishCnt
  FROM
    goods
  WHERE
    agentid = pi_AgnetId
    AND publishtime >= date_sub(c_CurrentDate, INTERVAL day(c_CurrentDate) - 1 DAY);
  -- 3 本月货源成交量
  SELECT count(1)
  INTO
    v_GoodsCompleteCnt
  FROM
    goods a
  WHERE
    agentid = pi_AgnetId
    AND a.goodsstatus = 2
    AND a.completetime >= date_sub(c_CurrentDate, INTERVAL day(c_CurrentDate) - 1 DAY);
  -- 4 本月货车新增量
  SELECT count(1)
  INTO
    v_CarNew
  FROM
    mycars
  WHERE
    agentid = pi_AgnetId
    AND generatetime >= date_sub(c_CurrentDate, INTERVAL day(c_CurrentDate) - 1 DAY);
  -- 5 新订单
  SELECT count(1)
INTO
  v_NEWOrderCnt
FROM
  orders
WHERE
  status = 0
  AND agentid = pi_AgnetId
  AND generatetime >= date_add(now(), INTERVAL -3 MONTH);
  -- 6 待收款
  SELECT count(1)
INTO
  v_MONOrderCnt
FROM
  orders
WHERE
  status = 4
  AND agentid = pi_AgnetId
  AND generatetime >= date_add(now(), INTERVAL -3 MONTH);
   -- 7 待评价
  SELECT count(1)
INTO
  v_COMOrderCnt
FROM
  orders
WHERE
  status = 5
  AND agentid = pi_AgnetId
  AND generatetime >= date_add(now(), INTERVAL -3 MONTH);
  SELECT ifnull(v_AgentBest, '') as AgentBest
     , ifnull(v_GoodsPublishCnt, 0) as GoodsPublishCnt
     , ifnull(v_GoodsCompleteCnt, 0) as GoodsCompleteCnt
     , ifnull(v_CarNew, 0) as CarNew
     , ifnull(v_NEWOrderCnt, 0) as NEWOrderCnt
     , ifnull(v_MONOrderCnt, 0) as MONOrderCnt
     , ifnull(v_COMOrderCnt, 0) as COMOrderCnt;
END ;;
DELIMITER ;
